function Navbar(props){
    
    
    const styles = {
        width: '1440px',
        height: '72px',
        background: '#001066'
    }

    return(
        <nav style={styles}>
             <p>{props.title}</p>
            <img src={props.avatar}/>
        </nav>
           
    )
}


export default Navbar
